import React from 'react';
import './FeedbackAnalytics.css';

const FeedbackAnalytics = () => {
  // Example events data
  const events = [
    { title: 'Event 1', description: 'Details of Event 1' },
    { title: 'Event 2', description: 'Details of Event 2' },
    { title: 'Event 3', description: 'Details of Event 3' }
  ];

  return (
    <div className="feedback-analytics">
      <h2>Feedback & Analytics</h2>

      <div className="stars">
        {/* Example star ratings */}
        <div className="star-container">
          <i className="star fas fa-star"></i>
          <div className="percentage-line" style={{ width: '80%' }}></div>
        </div>
        <div className="star-container">
          <i className="star fas fa-star"></i>
          <div className="percentage-line" style={{ width: '60%' }}></div>
        </div>
        <div className="star-container">
          <i className="star fas fa-star"></i>
          <div className="percentage-line" style={{ width: '40%' }}></div>
        </div>
      </div>

      <div className="feedback">
        {/* Feedback content */}
        <p>Here is some feedback and analytics information.</p>
      </div>

      {/* New events section */}
      <div className="events-section">
        <h3>Upcoming Events</h3>
        {events.map((event, index) => (
          <div key={index} className="event-item">
            <h4>{event.title}</h4>
            <p>{event.description}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default FeedbackAnalytics;
